import React from 'react';
import styles from './SlideForm.module.css';
import RoundButton from '../Util/RoundButton';
import {useDispatch,useSelector} from 'react-redux';
import {slideActions} from '../../store/index';

export default function SlideForm() {
    const isLogin = useSelector(state => state.slide.isLogin);

    const body1 = {};
    const body2 = {};

    const dispatch = useDispatch();
    const toggleSlide = () => {
        dispatch(slideActions.toggleSlide());
    }

    return (
        <div className={`${styles.slide} ${isLogin && styles.slide_animation}`}>
            <div className={styles.content_wrapper}>
                <div className={styles.container}>
                    <div className={styles.title}>
                        New Here?
                    </div>
                    <div className={styles.text}>You can create here and post your experience here.<br/>Share your post increase your view.</div>
                    <RoundButton Func={toggleSlide}  color={'#487fec'} bgcolor={'white'} type={'text'} value={'Xin chao'} />
                </div>
            </div>
        </div>
    )
}
